INSERT INTO `tbl_pages` (`id`, `title`, `nicename`, `content`, `doe`, `dou`, `metatitle`, `metakeyword`, `metadesc`) VALUES
(2,	'Privacy Policy',	'privacy-policy',	'&lt;p&gt;&lt;strong&gt;Privacy policy&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;GPS Remart Private Limited&amp;nbsp; is concerned about the privacy of its users (hereinafter referred to as &quot;You&quot; &quot;Your&quot; &quot;Yourself&quot;) accessing its website located at www.globalproductsshopping.com (&quot;Website&quot;) and has provided this Privacy Policy (&quot;Policy&quot;) to familiarize You with the manner in which GPS Remart Pvt. Ltd. collects, uses and discloses Your information collected through the Website.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;The Company&amp;rsquo;s Principles to protect Privacy&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;(a) &amp;nbsp;Security&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Wherever your Personal Information may be held within the Company, the Company intends to take reasonable steps to protect it from unauthorized access or disclosure. The Company is committed to protecting the security of your Personal Information. We use a variety of security technologies and procedures to help protect your Personal Information from unauthorized access, use, or disclosure.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;(b) &amp;nbsp;Choice&amp;nbsp;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;You may choose whether or not to provide Personal Information to the Company. If you choose not to provide the Personal Information we request, you can still visit most of the Company\'s Web site/s, but you may be unable to access certain options, offers, and services that involve our interaction with you. If you chose to have a relationship with the Company, such as a contractual or other business relationship, the Company will naturally continue to contact you in connection with that business relationship.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;(c) &amp;nbsp;Notice&amp;nbsp;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;Where the Company collects Personal Information on the Site, the company intends to do so for a legitimate purpose and the same purpose may be asked by you from the persons mentioned in the Contact tab. Unless the transfer of Personal Information is legally required, the Company does not intend to transfer Personal Information without your permission to third parties who are not bound to act on the Company\'s behalf.&amp;nbsp;&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;(d) &amp;nbsp;Access/Accuracy&amp;nbsp;&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;To the extent that you do provide the Company with Personal Information, the Company wishes to maintain accurate Personal Information. Where the Company collects Personal Information from you on the Site, its aim is to provide a means of contacting the Company should you need to update or correct that Information. If for any reason those means are unavailable or inaccessible, you may send updates and corrections about your Personal Information to admin@fastdealstoday.com and the Company will make reasonable efforts to incorporate the changes.&lt;/p&gt;',	'2017-01-16 21:55:41',	'0000-00-00 00:00:00',	'Privacy Policy',	'Privacy Policy',	'Privacy Policy'),
(3,	'About us',	'about-us',	'&lt;p&gt;&lt;strong&gt;About GPS Remart Private Limited&lt;/strong&gt;&lt;/p&gt;\r\n&lt;p&gt;First of all, thank you for taking the time out to know more about us. We would be more than happy to tell you about our website and our journey till date.&lt;/p&gt;\r\n&lt;p&gt;We feel proud to say that&lt;strong&gt;&amp;nbsp;globalproductsshopping.com&lt;/strong&gt; is one of the fastest growing e-commerce portals of India. The company has grown from a small online store that started its operations in January 2017 to become a leading online super store that offers a wide range of high quality products that are delivered to people all over India. Today, globalproductsshopping.com is the pride of its 4 founding directors and the joy of millions of satisfied customers who are spread across the nation.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;At globalproductsshopping.com we work towards attaining 100% satisfaction of our customers on every single order.&lt;/strong&gt;&amp;nbsp;Our customers are assured of an excellent shopping experience that comes from our easy to use online interface. Also, in order to guarantee a safe, secure and comfortable online payment process we have a number of options such as debit / credit cards, Net Banking and Cash on Delivery (COD) to suit any and everyone&amp;rsquo;s needs.&lt;/p&gt;\r\n&lt;p&gt;We at globalproductsshopping.com value your time and we understand that once you&amp;rsquo;ve placed an order, it&amp;rsquo;s really hard to keep waiting for it. Therefore, come hails or storm, you can sure that your product will be delivered. We work at delivering your product as soon as possible and in a timely and efficient manner.&lt;/p&gt;\r\n&lt;p&gt;As a leading online retailer we offer our customers a wide range of products that include top brand electronics, gaming devices, home and kitchen appliances as well as clothing and footwear for children, women and men. Our products are sourced from leading local and international manufacturers and our products are dispatched only after a thorough quality check, so that you get your product delivered in an excellent condition.&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;We also like to introduce offers and discounts from time to time to make shopping more fun for you and so you can shop without feeling a pinch in your pocket&lt;/strong&gt;.&amp;nbsp;We assure you that you&amp;rsquo;ll get a wide range of products at great prices on our website.&lt;/p&gt;\r\n&lt;p&gt;The feedback and suggestions on your shopping experiences at globalproductsshopping.com are welcomed. We would be happy if you take a tour of our website and choose us for all your shopping needs. Have a great day!&lt;/p&gt;\r\n&lt;p&gt;&lt;strong&gt;&lt;em&gt;GPS Remart Pvt. Ltd.&lt;/em&gt;&lt;/strong&gt;&lt;/p&gt;',	'2017-01-16 21:59:16',	'0000-00-00 00:00:00',	'About us',	'About us',	'About us'),
(4,	'Terms and Conditions ',	'terms-and-conditions',	'&lt;p&gt;This document is an electronic record in terms of applicable Information Technology laws and the amended provisions thereto pertaining to electronic records in various allied statutes as amended pursuant to the Information Technology laws. This electronic record has been generated by a computer system and does not require any authentication.&lt;/p&gt;\r\n&lt;ol&gt;\r\n&lt;li&gt;&lt;strong&gt;Introduction&lt;/strong&gt;&lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;&lt;strong&gt;globalproductsshopping.com&amp;nbsp;(Hereinafter referred to as the &amp;lsquo;Website&amp;rsquo;) &lt;/strong&gt;is an internet based e-commerce portal registered in the name of and being operated by GPS Remart Pvt. Ltd., a company incorporated under the Companies Act, 2013, having its registered office at&lt;strong&gt;New Delhi &amp;ndash; INDIA&lt;/strong&gt;&amp;nbsp;and is hereinafter referred to as the &amp;ldquo;Company&amp;rdquo;. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;The use of the Website, is subject to the terms of the instant legal agreement. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Through this e-commerce portal, the Company enables the Users of the Website, to purchase various kinds of merchandise including clothes and all kinds of accessories of leading brands (Hereinafter referred to as &amp;lsquo;Services&amp;rsquo;). Upon placing an order, the Company ships the selected product to the User at the address specified by the User upon making the payment through the payment gateway.&amp;nbsp; &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;The following terms and conditions will be deemed to have been accepted by the User, on mere usage of the Website and hence the User is required to read them carefully before using the services on the website, &lt;a href=&quot;http://www.globalproductsshopping.com&quot;&gt;globalproductsshopping.com&lt;/a&gt;. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ol start=&quot;2&quot;&gt;\r\n&lt;li&gt;&lt;strong&gt;DEFINITIONS&lt;/strong&gt; &lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;The term &amp;lsquo;User&amp;rsquo;/ &amp;lsquo;You&amp;rsquo; shall refer to the person who is browsing the said Website and the expression &amp;lsquo;your&amp;rsquo; shall be construed accordingly. The expression &amp;lsquo;You&amp;rsquo; and &amp;lsquo;User&amp;rsquo; are used interchangeably and shall mean one and the same thing. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;The term &amp;lsquo;Website&amp;rsquo; refers to&lt;strong&gt;globalproductsshopping.com&lt;/strong&gt;and other websites owned and monitored by the Company. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;The term &amp;lsquo;Company&amp;rsquo; shall refer to&lt;strong&gt;GPS Remart Pvt. Ltd.&lt;/strong&gt;&amp;nbsp;and shall include its affiliates. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ol start=&quot;3&quot;&gt;\r\n&lt;li&gt;&lt;strong&gt;USER ACCOUNT&lt;/strong&gt; &lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Every User shall have an option to register as a member by completing the step by step, self explanatory registration process contained on the Website. The User shall be provided a password at the stage of completion of the registration process. The User is required to ensure the confidentiality of the password and the account and shall be responsible for all activities/transactions done through its account and shall not hold the Company liable in any way for any misappropriation of information or loss, direct or indirect, caused to the User owing to the negligence in handling of the account. The User is required to notify the Company with immediate effect, in the event any unauthorized access, is gained into the User&amp;rsquo;s account. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;There is no fee to register as a member to the Website. However, the Company, at its sole discretion, reserves the right to make the registration on the Website, subject to such fee and for such term as the Company deems fit. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;All members shall be provided additional benefits compared to other Users of the Website. Such benefit/s shall be mentioned on a conspicuous place on the Website and may be modified/amended/withdrawn by the Company at its sole discretion. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ol start=&quot;4&quot;&gt;\r\n&lt;li&gt;&lt;strong&gt;ELIGIBILITY OF MEMBERS&lt;/strong&gt; &lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Use of the Company&amp;rsquo;s Website is available only to persons who are competent to contract under the Indian Contract Act, 1872. Persons who are &quot;incompetent to contract&quot; within the meaning of the Indian Contract Act, 1872, including minors, un-discharged insolvents etcetera are not eligible to use the Company&amp;rsquo;s Website. If the User is a minor i.e. under the age of 18 years, he/she shall not register as a member of the Company and shall not transact or use the Company&amp;rsquo;s website. As a minor if the User wishes to use or transact using the Company&amp;rsquo;s website, such use or transaction may be made by his/her legal guardian or parents who have registered as users of the Company. Company reserves the right to terminate the User&amp;rsquo;s membership and refuse to provide access to the Website, if it is brought to the Company&amp;rsquo;s notice or if it is discovered that he/she is under the age of 18 years. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ol start=&quot;5&quot;&gt;\r\n&lt;li&gt;&lt;strong&gt;BINDINGNESS OF PRIVACY POLICY AND TERMS OF USE&lt;/strong&gt; &lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;By using the Website, You agree to follow and be bound by the Privacy Policy and the terms and conditions concerning your use of the Website. The User\'s right to privacy is of paramount importance to the Company. Any information provided by the User will not be shared with any third party. The Company reserves the right to use the information to provide the User a more personalized online experience.&amp;nbsp; &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;The Company may revise the Terms of Use at any time without notice to You. Areas of the Website may have different terms of use posted. If there is a conflict between the present Terms of Use and the terms of use posted for a specific area of the Website, the latter shall have precedence with respect to your use of that area of the Website.&amp;nbsp; &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ol start=&quot;6&quot;&gt;\r\n&lt;li&gt;&lt;strong&gt;USER COVENANTS&lt;/strong&gt; &lt;/li&gt;\r\n&lt;/ol&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;You agree and undertake to use the Website and the services provided therein only to post and upload messages and material that are proper. Notwithstanding the generality of the above expression, you undertake not to use the Website in any manner to: &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Send, transmit, host, publish, upload nor cause to be so done, any information that is grossly offensive or has a menacing character or, which the user knows to be false, but still sends, transmits, hosts, publishes, uploads for the purpose of causing annoyance, inconvenience, danger, obstruction, insult, injury, criminal intimidation, enmity, hatred or ill will, to any person/s. &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Publish, post, upload, distribute or disseminate any inappropriate, profane, defamatory, infringing, racist, pornographic, obscene, indecent or unlawful topic, name, material or information; &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Defame, abuse, harass, stalk, threaten, annoy, upset or otherwise violate the legal rights of others; &lt;/li&gt;\r\n&lt;/ul&gt;\r\n&lt;ul&gt;\r\n&lt;li&gt;Upload files that contain software or other material protected by intellectual property laws unless you own or control the rights thereto or h